import React, { Component } from 'react';
import { View, StyleSheet, Animated } from 'react-native'

export default function Search() {
    return (
        <div>
            <img ></img>
            <Image style={Styles.photo}></Image>
            <p>Hengzhi Huang</p>
        </div>
    )
}

const Styles = StyleSheet.create({
    photo: {
        width: 40,
        height: 40,
        borderRadius: 22
    }
})
